import React from 'react'; // useState'e artık burada ihtiyaç yok
import { Dropdown } from 'primereact/dropdown';
import { RadioButton } from 'primereact/radiobutton';
import { Slider } from 'primereact/slider';

// PROPS OLARAK ALINAN DEĞERLER VE FONKSİYONLAR
const FilterSidebar = ({
    ratingValue, onRatingChange,
    distanceValue, onDistanceChange,
    selectedDifficulty, onDifficultyChange,
    onApply, onReset
}) => {

    // Veri listeleri burada kalabilir
    const difficulties = [
        { name: 'Kolay', key: 'Kolay', count: 42, color: 'bg-green-500' },
        { name: 'Orta', key: 'Orta', count: 28, color: 'bg-yellow-500' },
        { name: 'Zor', key: 'Zor', count: 14, color: 'bg-red-500' },
    ];
    // Diğer veri listeleri (kategori, süre vb.)

    return (
        <aside className="lg:col-span-1 flex flex-col space-y-6">

            {/* ... Diğer filtreler (Sıralama, Kategori, Süre) ... */}
            {/* Bu filtrelerin de aynı mantıkla props alması gerekir */}

            {/* Puan Aralığı Kartı */}
            <div className="bg-white p-6 rounded-2xl shadow-sm">
                <h3 className="text-lg font-semibold text-gray-800 flex items-center mb-4"><i className="pi pi-star mr-2"></i>Puan Aralığı</h3>
                <p className="text-sm text-gray-600 mb-3">Minimum Puan: {ratingValue.toFixed(1)}</p>
                {/* value ve onChange props'tan gelenleri kullanıyor */}
                <Slider value={ratingValue} onChange={(e) => onRatingChange(e.value)} min={1.0} max={5.0} step={0.1} className="w-full" />
                <div className="flex justify-between text-xs text-gray-500 mt-1"><span>1.0★</span><span>5.0★</span></div>
            </div>

            {/* Zorluk Seviyesi Kartı */}
            <div className="bg-white p-6 rounded-2xl shadow-sm">
                <h3 className="text-lg font-semibold text-gray-800 flex items-center mb-4"><i className="pi pi-bolt mr-2"></i>Zorluk Seviyesi</h3>
                <div className="space-y-4">{difficulties.map((difficulty) => (<div key={difficulty.key} className="flex items-center justify-between"><div className="flex items-center"><RadioButton inputId={difficulty.key} name="difficulty" value={difficulty.name} onChange={(e) => onDifficultyChange(e.value)} checked={selectedDifficulty === difficulty.name} /><label htmlFor={difficulty.key} className="ml-2 text-gray-700">{difficulty.name}</label></div><span className={`text-sm text-white font-medium px-2.5 py-0.5 rounded-full ${difficulty.color}`}>{difficulty.count}</span></div>))}</div>
            </div>

            {/* Mesafe (km) Kartı */}
            <div className="bg-white p-6 rounded-2xl shadow-sm">
                <h3 className="text-lg font-semibold text-gray-800 flex items-center mb-4"><i className="pi pi-map-marker mr-2"></i>Mesafe (km)</h3>
                <p className="text-sm text-gray-600 mb-3">Maksimum Mesafe: {distanceValue} km</p>
                 {/* value ve onChange props'tan gelenleri kullanıyor */}
                <Slider value={distanceValue} onChange={(e) => onDistanceChange(e.value)} min={1} max={50} className="w-full" />
                <div className="flex justify-between text-xs text-gray-500 mt-1"><span>1 km</span><span>50+ km</span></div>
            </div>

            {/* Butonlar */}
            <div className="space-y-3">
                {/* Butonlar artık props'tan gelen fonksiyonları çağırıyor */}
                <button onClick={onApply} className="w-full flex justify-center items-center py-3 px-4 font-semibold text-white rounded-xl bg-gradient-to-r from-cyan-500 to-orange-400 hover:opacity-90 shadow-md">
                    <i className="pi pi-check mr-2"></i>Filtreleri Uygula
                </button>
                <button onClick={onReset} className="w-full flex justify-center items-center py-3 px-4 font-semibold text-gray-700 bg-white border border-gray-300 rounded-xl hover:bg-gray-100">
                    <i className="pi pi-refresh mr-2"></i>Filtreleri Sıfırla
                </button>
            </div>
        </aside>
    );
};

export default FilterSidebar;
